import * as React from "react";
import Box from "@mui/material/Box";

function BoxSx() {
  return (
    <Box
      sx={{
        width: 300,
        height: 300,
        backgroundColor: "primary.dark",
        }}
    />
    
  );
}

export default BoxSx;
